import React from "react";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";

export default function Spese() {
  return (
    <Grid
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "rgb(20, 42, 58)",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        style={{
          height: "90%",
          width: "80%",
          //backgroundColor: "rgb(203, 231, 253)",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "10%",
            width: "100%",
            //backgroundColor: "rgb(94, 175, 70)",
          }}
        >
          <Typography
            variant="h4"
            style={{ color: "#fcfcfc" }}
            sx={{ fontWeight: "bold" }}
          >
            Spese page
          </Typography>
        </Grid>
        <Grid
          container
          direction="column"
          style={{
            borderRadius: "5%",
            height: "90%",
            width: "100%",
            backgroundColor: "rgb(203, 231, 253)",
          }}
        >
          <Grid
            container
            direction="column"
            justifyContent="center"
            style={{
              height: "75%",
              width: "100%",
              backgroundColor: "rgb(93, 131, 53)",
            }}
          ></Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            style={{
              height: "25%",
              width: "100%",
              backgroundColor: "rgb(193, 31, 153)",
            }}
          ></Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}
